import React, { Component } from "react";

class Form extends Component {
  state = {
    name: "",
    nameError: "",
    email: "",
    emailError: "",
    password: "",
    passwordError: "",
    url: "",
    urlError: ""
  };

  render() {
    return (
      <div>
        <h1>Forma ideale</h1>
        <div>
          <label>name</label>
          <input
            name="name"
            type="text"
            value={this.state.name}
            onChange={e => {
              this.setState({ name: e.target.value });
              console.log(this.state.name);
            }}
          />
        </div>
        <div>
          <label>mail</label>
          <input type="email" />
        </div>
        <div>
          <label>password</label>
          <input type="password" />
        </div>
        <div>
          <label>URL</label>
          <input type="url" />
        </div>
      </div>
    );
  }
}

export default Form;
